import React, {Component} from 'react';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import ListGroup from 'react-bootstrap/ListGroup';
import Machine from './Machine'

class MachineList extends Component {



  render() {
    return (
      <div className="machine-card">
        <Card bg="secondary" text="dark">
          <Card.Header>
            <Button>
              {this.props.type} Machines
            </Button>
          </Card.Header>

          <ListGroup variant="flush">
            <ListGroup.Item bg="dark"><Machine type={this.props.type} tierAmount={this.props.tierAmount} mining={this.props.mining}/></ListGroup.Item>
            <ListGroup.Item><Machine type={this.props.type} mining={this.props.mining}/></ListGroup.Item>
            <ListGroup.Item>Vestibulum at eros</ListGroup.Item>
          </ListGroup>

        </Card>
      </div>
    )
  }
}
 export default MachineList;
